namespace MSlwk\Otomoto\App\Test\Unit\Model\Scrapper;

use MSlwk\Otomoto\App\Model\Data\ModelDTOArray;
use MSlwk\Otomoto\App\Model\Scrapper\ModelHtmlScrapper;
use PHPUnit\Framework\TestCase;

/**
 * Class ModelHtmlScrapperTest
 * @package MSlwk\Otomoto\App\Test\Unit\Model\Scrapper
 */
class ModelHtmlScrapperTest extends TestCase
{
    /**
     * @test
     * @dataProvider htmlDataProvider
     * @param $html
     */
    public function testScrapperReturnsCorrectModelsArray($html)
    {
        $scrapper = new ModelHtmlScrapper();

        $models = $scrapper->scrapModels($html);
        $expectedType = ModelDTOArray::class;
        $expectedCount = 19;
        $expectedNameOfFirstItem = 'Stelvio';

        $this->assertInstanceOf($expectedType, $models);
        $this->assertEquals($expectedCount, $models->count());
        $this->assertEquals($expectedNameOfFirstItem, $models->current()->getName());
    }

